import { Box, Container, Grid } from "@mui/material";
import CreateTeam from "./components/CreateTeam";

export default function CreatePost() {
    return (
       <main>
           <Box sx={{ bgcolor: 'background.paper', pt: 8, pb: 6, }}>
                <Container>
                    <Grid container spacing={2} align='center'>
                        <CreateTeam />
                        <CreateTeam />
                        <CreateTeam />
                    </Grid>
                </Container>
           </Box>
       </main> 
    )
};
